import Shadows from "../components/Shadows";
import "../styles_css/Terms.css";

const Terms = () => {
  return (
    <div>
      <div className="hero">
        <Shadows />

        <h1 className="main-heading">Jobs</h1>
        <p className="subheading">
          Innovating without limits, empowering your vision
        </p>
      </div>
    </div>
  );
};

export default Terms;
